import WineCard from '../WineCard/WineCard';

export default function WineList ({wineList}) {

  return (<div>

    <div >
    <button onClick={() => console.log(wineList)}>get WineList</button>

    {wineList.map((wine,index) => {
      return (<div><WineCard wine={wine} /></div>)})}

    </div>


  </div>)

}
